import React from "react";
import Ecom from "../Ecom.js";

export default function Home() {
  let isLoggedIn = Ecom.getCookie("session-member-record");
  const sideBtnClick = () => {

  }
  if (isLoggedIn) {
    return (
      <>
        <div class="sidebar">
          <a href="#home">
            <i class="fa fa-fw fa-home"></i> Home
          </a>
          <a href="#services">
            <i class="fa fa-fw fa-wrench"></i> Services
          </a>
          <a href="#clients">
            <i class="fa fa-fw fa-user"></i> Clients
          </a>
          <a href="#contact">
            <i class="fa fa-fw fa-envelope"></i> Contact
          </a>
        </div>
        <div class="main">
          <div id="sideBtn" onClick={sideBtnClick}>
            <i class="fa fa-bars"></i>
          </div>
          <div id="content">
            <h2>Sidebar with Icons</h2>
            <p>
              This side navigation is of full height (100%) and always shown.
            </p>
          </div>
        </div>
      </>
    );
  } else {
    return <h1>Not Set</h1>;
  }
}
